import React from "react";
import { Badge } from "reactstrap";

class Chip extends React.Component {
  render() {
    return (
      <div>
        <Badge className="chip-body" color="default" pill>
          <p>{this.props.label}</p>
        </Badge>
      </div>
    );
  }
}

export default Chip;
